        { id:4,   img:image,     name:"mugahe",   phone:"+684 546745774",    email: "sds@gmain.ocom"},
        { id:1,   img:image,     name:"tamer",    phone:"+684 234546546",    email: "sds@gmain.ocom"},
        { id:2,   img:image,     name:"ola",      phone:"+684 898785675",    email: "sds@gmain.ocom"},
        ];

        // const obj=[
        //     {name:"ayman"},
        //     {name:"ahmed"},
        //     {name:"saleh"},
        //     {name:"mohmmed"},
        //     ]
    const S= obj.map(function(e){
        return(<ConCard 
            name={e.name}
            img={e.img}
            img={e.img}
            img={e.img}
        />)
        })
        return (
    <div className="container mt-4 rounded " style={{ background: "red" }}>
      <div className="row" >
     {S}
      </div>
    </div>
  );
}

export default Cards;
